# [560] Subarray Sum Equals K
#

# @lc code=start
class Solution:
    def subarraySum(self, nums: List[int], k: int) -> int:
        pre_sum = [0]
        m = {}
        for i in range(len(nums)):
            if pre_sum[-1]+nums[i] in m:
                m[pre_sum[-1]+nums[i]].append(i)
            else:
                m[pre_sum[-1]+nums[i]] = [i]

            pre_sum.append(pre_sum[-1]+nums[i])
        
        cnt = 0
        for i in range(len(nums)):
            if k + pre_sum[i] in m:
                for index in m[k + pre_sum[i]]:
                    if index >= i:
                        cnt += 1
        return cnt
